INSERT INTO `bc_info` (`pk`, `id`, `section_id`, `language`, `slug`, `title`, `description`, `content`, `url`, `start_date`, `end_date`, `thumbnail`, `lng`, `lat`, `published`, `important`, `slider`, `connected_gall`, `connected_info`, `sort`, `important_type`) VALUES
(122, 47, 14, 'en', '1970-01-01-aim-and-time-commited', 'Aim and time commited. This is TEST version do not try to participate', '<p>This study aims to find new correlations between what you buy and your health, using receipt data donated by you.<br />\r\n<a href=\"http://www.nordicehealth.se/InformedConsent-app/html/#\" style=\"margin: 0px; padding: 0px; transition:background-color 0.2s; color: rgb(243, 130, 134); text-decoration: none; box-sizing: border-box; background-color: transparent;\">Our initial focus will be on the determinants of flares in chronic diseases.</a><br />\r\nThe purpose of this form is to help you to decide whether you want to participate in the study.<br />\r\nWe expect participating in the study, reading, and filling out this form will take 10 to 15 minutes.</p>\r\n\r\n<p>You must be at least 18 years old to participate.</p>', '<p>This study aims to find new correlations between what you buy and your health, using receipt data donated by you.<br />\r\n<a href=\"http://www.nordicehealth.se/InformedConsent-app/html/#\" style=\"margin: 0px; padding: 0px; transition:background-color 0.2s; color: rgb(243, 130, 134); text-decoration: none; box-sizing: border-box; background-color: transparent;\">Our initial focus will be on the determinants of flares in chronic diseases.</a><br />\r\nThe purpose of this form is to help you to decide whether you want to participate in the study.<br />\r\nWe expect participating in the study, reading, and filling out this form will take 10 to 15 minutes.</p>\r\n\r\n<p>You must be at least 18 years old to participate.</p>\r\n\r\n<h1>The consent</h1>\r\n\r\n<p>Your consent to participate is entirely voluntary and you can, at any time, withdraw from the study and have your data deleted. Data identifying you is securely stored and will not be disclosed to any third party without your consent. Any medical treatment you receive is not affected by your participation, but your participation may improve treatment and prevention in the future.</p>\r\n\r\n<p>It is important that we explain the study properly to you, and we will therefore ask some questions at the end of this form, to ensure that we have infromed you adequatly.</p>\r\n\r\n<h2>Why participate (background)</h2>\r\n\r\n<p>There is a lack of knowlegde regarding how our lifestyle, i.e. everything we eat, drink, breathe, and apply to our skin. affects our health.</p>\r\n\r\n<h2>Why participate (method)</h2>\r\n\r\n<p>We invite you to help us increase our knowledge of how our lifestyle and surroundings affect our health. You can help us by agreeing to donate your receipts data for research. Along with health information from public records we can discover new knowledge.</p>\r\n\r\n<h2>Why participate (usefulness)</h2>\r\n\r\n<p>Because this data can be collected over a long time, we can find patterns in data that can potetially lead us to determinants of several diseases and thus perhaps even prevent some diseases in the future, that might affect you or your loved ones.</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0);
INSERT INTO `bc_info` (`pk`, `id`, `section_id`, `language`, `slug`, `title`, `description`, `content`, `url`, `start_date`, `end_date`, `thumbnail`, `lng`, `lat`, `published`, `important`, `slider`, `connected_gall`, `connected_info`, `sort`, `important_type`) VALUES
(106, 35, 7, 'en', '1970-01-01-how-this-study-works', 'How this Study Works', '', '<p>Have you ever wondered if any of the addititves, chemicals or food you eat might prevent or promote disease onset?</p>\r\n\r\n<p>We invite you to help us increase our knowledge of how our lifestyle and surroundings affect our health. You can help us by agreeing to donate your receipts data&nbsp;long with health information from public records. We can use the data donated by you and others to&nbsp;discover new knowledge.</p>\r\n\r\n<p>Because this data can be collected over a long time and with great detail, we can find patterns in data that can potentially lead us to determinants of several diseases and thus perhaps even prevent some diseases in the future, that might affect you or your loved ones.</p>', '', NULL, NULL, '4998Billede1.jpg', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(112, 37, 8, 'en', '2016-08-19-mads-melbye-professor', 'Mads Melbye, Professor', '<p>Mads Melbye is the President (CEO) of Statens Serum Institut. His main focus has been in population health science research taking advantage of the unique Nordic population based registers and biobanks. He has gained experience in performing large scale epidemiologic studies based on e.g. the Nordic national registries, and the Danish National Birth Cohort. In the last decade, the research has been described three times in more general articles in Science, with titles as &ldquo;When an entire country is a cohort,&rdquo; &ldquo;The epidemiologist&rsquo;s dream: Denmark&rdquo; and &ldquo;Science gold mine&rdquo;. Professor Melbye regards the present study as a unique opportunity to investigate the impact of&nbsp;everyday purchases on our health.</p>', '<p>Mads Melbye is the President (CEO) of Statens Serum Institut. His main focus has been in population health science research taking advantage of the unique Nordic population based registers and biobanks. He has gained experience in performing large scale epidemiologic studies based on e.g. the Nordic national registries, and the Danish National Birth Cohort. In the last decade, the research has been described three times in more general articles in Science, with titles as &ldquo;When an entire country is a cohort,&rdquo; &ldquo;The epidemiologist&rsquo;s dream: Denmark&rdquo; and &ldquo;Science gold mine&rdquo;. Professor Melbye regards the present study as a unique opportunity to investigate the impact of&nbsp;everyday purchases on our health.</p>', '', '2016-08-19 11:15:06', '2016-08-19 11:15:06', '44109203MadsMelbye.jpg', NULL, NULL, 'Y', 'Y', 'N', 0, '', 0, 1),
(129, 55, 20, 'en', '1970-01-01-perform-simple-tasks', 'Perform simple tasks', '<p>Perform simple tasks ...</p>', '<p><span style=\"color:rgb(35, 31, 32); font-size:14.0625px\">We&#39;ll ask you to do a few tasks and answer some questions about your</span></p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(130, 54, 19, 'en', '1970-01-01-give-consent-to-enroll', 'Give consent to enroll', '<p>Understand the risks and benefits of participating.</p>', '<p><span style=\"color:rgb(35, 31, 32); font-size:14.0625px\">Understand the risks and benefits of participating.</span></p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(103, 34, 6, 'en', '1970-01-01-about-this-study', 'About this study', '<p><em><strong>Have you ever wondered if any of the additives, chemicals or food you eat might prevent or promote disease onset?</strong></em></p>\r\n\r\n<p>You can become a research partner by simply agreeing to donate your digital receipts to us, and allow us to collect information about your health. In turn we will do our utmost to protect your data, and use your data improve health.</p>', '<p><em><strong><span style=\"font-size:10pt\">Have you ever wondered if any of the additives, chemicals or food you eat might prevent or promote disease onset?</span></strong></em></p>\r\n\r\n<p><span style=\"font-size:10pt\">For years questionnaires has been used to study how our lifestyle affects our health, but for many diseases this research has been in vain. I this study, we will use a novel method;&nbsp;information about purchasing pattern. This allows&nbsp;us to analyze how lifestyle affects a number of diseases in much greater detail and over a longer timespan than ever&nbsp;tried before.&nbsp;It is our hypothesis that this will enable us to&nbsp;provide lifestyle advice that may prevent disease onset and reactivation in a number of diseases where such advice is not available today. </span></p>\r\n\r\n<p><span style=\"font-size:10pt\">You can become a research partner by simply agreeing to donate your digital receipts to us, and allow us to collect information about your health. In turn we will do our utmost to protect your data, and use your data improve health.</span></p>\r\n\r\n<p>&nbsp;</p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(132, 49, 16, 'dk', '1970-01-01-is-there-any-risk-to-me', 'Er der en risiko ved at deltage?', '<p><strong>Er der en risiko ved at deltage?</strong></p>\r\n\r\n<p>Der er ingen helbredsrisiko forbundet med projektet. Vi forventer derimod, at projektet vil kunne komme dig til gavn inden for f&aring; &aring;r gennem bedre r&aring;dgivning omkring din sundhed.</p>\r\n\r\n<p>Din datasikkerhed er vigtig for os. Vi har derfor omfattende sikring af data mod tyveri og destruktion, og lever op til retningslinjer for omgang med personlige oplysninger inklusiv logning af adgang. Som med alle andre data er der risiko for at personer kan f&aring; uautoriseret adgang til data, trods vores indsats for det at undg&aring; dette. Vi vurderer dog at denne risiko er meget lille. Blandt andet sikrer vi, at databasen med oplysninger om din identitet, holdes adskilt fra databaser med de &oslash;vrige oplysninger.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Oplysninger om dine indk&oslash;b</strong></p>\r\n\r\n<p>Hvis du beslutter at deltage, modtager vi dine indk&oslash;bsdata fra virksomheder der tilbyder elektroniske kvitteringer som eksemplevis &nbsp;Storebox. Storebox bruger du m&aring;ske hvis du f&aring;r kvitteringer via mobilepay.</p>\r\n\r\n<p>Via disse links kan du se Storebox persondatapolitik&nbsp;&nbsp;<a href=\"https://dk.storebox.com/beta/#/webview/terms\" target=\"_blank\">her</a>&nbsp;( links &aring;bnes i nyt vindue).</p>', '<p><strong>Er der en risiko ved at deltage?</strong></p>\r\n\r\n<p>Der er ingen helbredsrisiko forbundet med projektet. Vi forventer derimod, at projektet vil kunne komme dig til gavn inden for f&aring; &aring;r gennem bedre r&aring;dgivning omkring din sundhed.</p>\r\n\r\n<p>Din datasikkerhed er vigtig for os. Vi har derfor omfattende sikring af data mod tyveri og destruktion, og lever op til retningslinjer for omgang med personlige oplysninger inklusiv logning af adgang. Som med alle andre data er der risiko for at personer kan f&aring; uautoriseret adgang til data, trods vores indsats for det at undg&aring; dette. Vi vurderer dog at denne risiko er meget lille. Blandt andet sikrer vi, at databasen med oplysninger om din identitet, holdes adskilt fra databaser med de &oslash;vrige oplysninger.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Oplysninger om dine indk&oslash;b</strong></p>\r\n\r\n<p>Hvis du beslutter at deltage, modtager vi dine indk&oslash;bsdata fra virksomheder der tilbyder elektroniske kvitteringer som eksemplevis &nbsp;Storebox. Storebox bruger du m&aring;ske hvis du f&aring;r kvitteringer via mobilepay.</p>\r\n\r\n<p>Via disse links kan du se Storebox persondatapolitik&nbsp;&nbsp;<a href=\"https://dk.storebox.com/beta/#/webview/terms\" target=\"_blank\">her</a>&nbsp;( links &aring;bnes i nyt vindue).</p>', '', NULL, NULL, '4499Slide4.JPG', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(133, 57, 22, 'dk', '1970-01-01-scientists-make-discoveries', 'Forskere finder vigtig ny viden', '', '<p>Forskere kan bruge dine og andres donerede data til at finde vigtig ny viden om hvordan sygdomme opst&aring;r og m&aring;ske hvordan de kan forebygges</p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(134, 56, 21, 'dk', '1970-01-01-track-your-health', 'Vi analyserer dine og andres data', '', '<p><span style=\"font-size:14.0625px\">Vi analyserer dine og andres data</span></p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(135, 50, 17, 'dk', '1970-01-01-consent-aproach', 'Samtykke til at deltage', '<p><strong>Samtykke til at deltage</strong></p>\r\n\r\n<p>Du giver dit samtykke og deltager ved:</p>\r\n\r\n<p>1.&nbsp;&nbsp; At udfylde felterne vedr&oslash;rende eventuel l&aelig;ngerevarende sygdom&nbsp;nedenfor.&nbsp;</p>\r\n\r\n<p>2.&nbsp;&nbsp; Udfylder kontaktoplysinger,&nbsp;inklusiv de oplysninger du har registreret hos Storebox, hvis disse&nbsp;er forskellige fra de&nbsp;angivne kontaktoplysinger.</p>\r\n\r\n<p>3.&nbsp;&nbsp; Giver dit samtykke via nem-id.</p>\r\n\r\n<p>4.&nbsp;&nbsp; Indtaster valideringskode fra Storebox&nbsp;p&aring; kvitteringssiden efter samtykke er givet (din sikkerhed for at andre ikke kan tilmelde dig uden dit samtykk</p>\r\n\r\n<p>5.&nbsp; &nbsp;Lider du af en eller flere kroniske sygdomme kan du angive dem nedenfor.</p>\r\n\r\n<p>6.&nbsp; &nbsp;Selv hvis du ikke lider af nogen sygdomme vil vi meget gerne have at du deltager alligevel da indk&oslash;bsdata fra raske mennesker kan benyttes ved sammenligninger mellem syge og raske.</p>', '<p><strong>Samtykke til at deltage</strong></p>\r\n\r\n<p>Du giver dit samtykke og deltager ved:</p>\r\n\r\n<p>1.&nbsp;&nbsp; At udfylde felterne vedr&oslash;rende eventuel l&aelig;ngerevarende sygdom&nbsp;nedenfor.&nbsp;</p>\r\n\r\n<p>2.&nbsp;&nbsp; Udfylder kontaktoplysinger,&nbsp;inklusiv de oplysninger du har registreret hos Storebox, hvis disse&nbsp;er forskellige fra de&nbsp;angivne kontaktoplysinger.</p>\r\n\r\n<p>3.&nbsp;&nbsp; Giver dit samtykke via nem-id.</p>\r\n\r\n<p>4.&nbsp;&nbsp; Indtaster valideringskode fra Storebox&nbsp;p&aring; kvitteringssiden efter samtykke er givet (din sikkerhed for at andre ikke kan tilmelde dig uden dit samtykk</p>\r\n\r\n<p>5.&nbsp; &nbsp;Lider du af en eller flere kroniske sygdomme kan du angive dem nedenfor.</p>\r\n\r\n<p>6.&nbsp; &nbsp;Selv hvis du ikke lider af nogen sygdomme vil vi meget gerne have at du deltager alligevel da indk&oslash;bsdata fra raske mennesker kan benyttes ved sammenligninger mellem syge og raske.</p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(136, 51, 18, 'dk', '1970-01-01-receipt-page', 'Tak for din deltagelse i projektet', '', '<p>Du er nu n&aelig;sten klar til at hj&aelig;lpe&nbsp;folk med kroniske sygdomme hver gang du k&oslash;ber ind...</p>\r\n\r\n<p>Nu mangler vi kun at du udfylder din mailadresse igen ovenfor og&nbsp;det andet felt hvor du kan indtaste den bekr&aelig;ftigelses kode du om lidt modtager fra Storebox.</p>\r\n\r\n<p>Hvis du ikke allerede har en storebox konto, men &oslash;nsker at deltage i projektet kan du nu tilmelde dig storebox, og vende tilbage til denne side n&aring;r du har tilmeldt dig.</p>\r\n\r\n<p><a href=\"https://dk.storebox.com/beta/#/signup/info\" target=\"_blank\">https://dk.storebox.com/beta/#/signup/info</a></p>\r\n\r\n<p>Du kan altid vende tilbage til vores hjemmeside og l&aelig;se nyheder om projektet,&nbsp;eller afmelde dig hvis du ikke l&aelig;ngere &oslash;nsker at deltage.</p>\r\n\r\n<p>Hvis du har tilmeldt dig vores nyhedsbrev vil du v&aelig;re blandt de f&oslash;rste til at h&oslash;re om de nye muligheder for personlig r&aring;dgivning dette projekt &aring;bner p&aring; sigt.</p>\r\n\r\n<p>Tak for din deltagelse.</p>\r\n\r\n<p>&nbsp;</p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(137, 48, 15, 'dk', '1970-01-01-the-consent', 'The consent', '<p>Your consent to participate is entirely voluntary and you can, at any time, withdraw from the study and have your data deleted. Data identifying you is securely stored and will not be disclosed to any third party without your consent. Any medical treatment you receive is not affected by your participation, but your participation may improve treatment and prevention in the future.</p>\r\n\r\n<p>It is important that we explain the study properly to you, and we will therefore ask some questions at the end of this form, to ensure that we have infromed you adequatly.</p>\r\n\r\n<p>Why participate (background)</p>\r\n\r\n<p>There is a lack of knowlegde regarding how our lifestyle, i.e. everything we eat, drink, breathe, and apply to our skin. affects our health.</p>\r\n\r\n<p>Why participate (method)</p>\r\n\r\n<p>We invite you to help us increase our knowledge of how our lifestyle and surroundings affect our health. You can help us by agreeing to donate your receipts data for research. Along with health information from public records we can discover new knowledge.</p>\r\n\r\n<p>Why participate (usefulness)</p>\r\n\r\n<p>Because this data can be collected over a long time, we can find patterns in data that can potetially lead us to determinants of several diseases and thus perhaps even prevent some diseases in the future, that might affect you or your loved ones.</p>', '<p>Your consent to participate is entirely voluntary and you can, at any time, withdraw from the study and have your data deleted. Data identifying you is securely stored and will not be disclosed to any third party without your consent. Any medical treatment you receive is not affected by your participation, but your participation may improve treatment and prevention in the future.</p>\r\n\r\n<p>It is important that we explain the study properly to you, and we will therefore ask some questions at the end of this form, to ensure that we have infromed you adequatly.</p>\r\n\r\n<h2>Why participate (background)</h2>\r\n\r\n<p>There is a lack of knowlegde regarding how our lifestyle, i.e. everything we eat, drink, breathe, and apply to our skin. affects our health.</p>\r\n\r\n<h2>Why participate (method)</h2>\r\n\r\n<p>We invite you to help us increase our knowledge of how our lifestyle and surroundings affect our health. You can help us by agreeing to donate your receipts data for reseach. Along with health information from public records we can discover new knowledge.</p>\r\n\r\n<h2>Why participate (usefulness)</h2>\r\n\r\n<p>Because this data can be collected over a long time, we can find patterns in data that can potetially lead us to determinants of several diseases and thus perhaps even prevent some diseases in the future, that might affect you or your loved ones.</p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(138, 36, 9, 'dk', '2016-08-19-who-is-eligible-to-participate', 'Hvem kan deltage', '<p>Alle&nbsp;der accepterer at deres&nbsp;indk&oslash;bsdata benyttes til forskning&nbsp;kan deltage og dermed bidrage til at finde ud af&nbsp;<strong><em>hvordan det vi k&oslash;ber, herunder vores&nbsp;kost, p&aring;virker helbredet</em></strong>.</p>\r\n\r\n<p>Du kan deltage, hvis du er over 18 &aring;r og har Nem-ID. Oplysningerne om indk&oslash;bsm&oslash;nstrene og dit helbred kan vi indsamle automatisk uden besv&aelig;r for dig, s&aring; det tager kun f&aring; minutter at deltage i projektet.</p>\r\n\r\n<p>Selvom vi i starten af projektet fokuserer p&aring; visse sygdomme, kan du donere dine data uanset om du er sund og rask, eller har en eller flere sygdomme.</p>\r\n\r\n<p>Hvis du beslutter at deltage,&nbsp;modtager vi dine indk&oslash;bsdata fra virksomheder der tilbyder elektroniske kvitteringer.</p>\r\n\r\n<p>Du skal derfor v&aelig;re&nbsp;medlem af&nbsp;<a href=\"https://medlem.coop.dk\" target=\"_blank\">COOP</a>&nbsp;og/eller f&aring;&nbsp;elektroniske kvitteringer fra&nbsp;<a href=\"https://dk.storebox.com\" target=\"_blank\">Storebox</a>&nbsp;for at deltage.</p>\r\n\r\n<p>Se politik for personoplysninger fra COOP&nbsp;<a href=\"https://medlem.coop.dk/datapolitikterms\" target=\"_blank\">her</a>&nbsp;og Storebox&nbsp;<a href=\"https://dk.storebox.com/#/webview/terms\" target=\"_blank\">her</a>.</p>\r\n\r\n<p>For at f&aring; de bedste og mest pr&aelig;cise data er det vigtigt at <strong>alle voksne der k&oslash;ber ind i din hustand </strong>melder sig til projektet via denne l&oslash;sning.</p>', '<p>Alle&nbsp;der accepterer at deres&nbsp;indk&oslash;bsdata benyttes til forskning&nbsp;kan deltage og dermed bidrage&nbsp;til at finde ud af&nbsp;<strong><em>hvordan det vi k&oslash;ber, herunder vores&nbsp;kostvaner, p&aring;virker helbredet</em></strong>.&nbsp;</p>\r\n\r\n<p>Du kan deltage, hvis du er over 18 &aring;r og har Nem-ID.&nbsp;Oplysningerne om indk&oslash;bsm&oslash;nstrene og dit helbred kan vi indsamle automatisk uden besv&aelig;r for dig, derfor&nbsp;tager det kun&nbsp;f&aring; minutter at deltage i projektet.</p>\r\n\r\n<p>Selvom vi i starten af projektet fokuserer p&aring; visse sygdomme, kan du donere dine data uanset om du er sund og rask, eller har en eller flere sygdomme.</p>\r\n\r\n<p>Hvis du beslutter at deltage,&nbsp;modtager vi dine indk&oslash;bsdata fra virksomheder der tilbyder elektroniske kvitteringer.</p>\r\n\r\n<p>Du skal derfor v&aelig;re&nbsp;medlem af&nbsp;<a href=\"https://medlem.coop.dk\" target=\"_blank\">COOP</a>&nbsp;og/eller f&aring;&nbsp;elektroniske kvitteringer fra&nbsp;<a href=\"https://dk.storebox.com\" target=\"_blank\">Storebox</a>&nbsp;for at deltage.</p>\r\n\r\n<p>Se politik for personoplysninger fra COOP&nbsp;<a href=\"https://medlem.coop.dk/datapolitikterms\" target=\"_blank\">her</a>&nbsp;og Storebox&nbsp;<a href=\"https://dk.storebox.com/#/webview/terms\" target=\"_blank\">her</a>.</p>\r\n\r\n<div>For at f&aring; de bedste og mest pr&aelig;cise data er det vigtigt at&nbsp;<strong>alle voksne der k&oslash;ber ind i din hustand&nbsp;</strong>melder sig til projektet via denne l&oslash;sning.</div>', '', '2016-08-19 00:00:00', '2016-08-19 01:00:00', '', NULL, NULL, 'Y', 'Y', 'N', 0, '', 0, 0),
