(148, 47, 14, 'dk', '1970-01-01-aim-and-time-commited', 'Formål og forventet tidsforbrug, OBS dette er en testversion forsøg ikke at tilmelde dig.', '<p><strong>Form&aring;l og forventet tidsforbrug OBS TEST VERSION </strong></p>\r\n\r\n<p>Vi ved stadig for lidt om, hvordan vores omgivelser og alt hvad vi spiser, drikker, ind&aring;nder og sm&oslash;rer os med, p&aring;virker vores sundhed.</p>\r\n\r\n<p>Form&aring;let med dette projekt er at unders&oslash;ge hvordan det vi k&oslash;ber, herunder vores kost, p&aring;virker helbredet, ved at analysere indk&oslash;bsm&oslash;nstre og helbredsoplysninger over tid.</p>\r\n\r\n<p>Du kan deltage, hvis du er over 18 &aring;r og har Nem-ID. Oplysninger om indk&oslash;bsm&oslash;nster og helbred kan vi indsamle automatisk fra virksomheder der tilbyder elektroniske kvitteringer, hvis du giver dit samtykke til dette.</p>\r\n\r\n<p>Vi forventer, at det kun vil tage dig f&aring; minutter at l&aelig;se formularen og deltage i projektet,</p>\r\n\r\n<p>Selvom vi i starten af projektet fokuserer p&aring; visse sygdomme, kan du donere dine data uanset om du er sund og rask, eller har en eller flere sygdomme.</p>\r\n\r\n<p>Vores fokus vil i starten is&aelig;r v&aelig;re p&aring;, hvordan opblussen i kroniske sygdomme p&aring;virkes af vores livsstil og hvordan vi kan blive bedre til at opspore madvarer som giver d&aring;rlig mave.&nbsp;</p>\r\n\r\n<p>Form&aring;let med denne formular er, at hj&aelig;lpe dig til at beslutte, om du &oslash;nsker at deltage i unders&oslash;gelsen.</p>\r\n\r\n<p><strong>Om samtykket</strong></p>\r\n\r\n<p>Dit samtykke til at deltage er helt frivilligt, og du kan til enhver tid udtr&aelig;de af unders&oslash;gelsen og bede om, at f&aring; dine data slettet.</p>\r\n\r\n<p>Eventuel l&aelig;gelig behandling vil ikke blive ber&oslash;rt af, om du deltager eller ej.</p>\r\n\r\n<p>S&aring;fremt vi &oslash;nsker at videregive dine indk&oslash;bsdata til et nyt forskningsprojekt, s&aring; vil vi indhente et nyt samtykke fra dig.</p>\r\n\r\n<p>Vi stiller dig nogle sp&oslash;rgsm&aring;l til sidst for at sikre, at vi har f&aring;et forklaret projektet ordentligt til dig.</p>\r\n\r\n<p><strong>Hvorfor deltage (baggrund)</strong></p>\r\n\r\n<p>Vi ved stadig for lidt om, hvordan vores omgivelser og alt hvad vi spiser, drikker, ind&aring;nder og sm&oslash;rer os med, p&aring;virker vores sundhed.</p>\r\n\r\n<p><strong>Hvorfor deltage (metode)</strong></p>\r\n\r\n<p>Vi vil invitere dig til at v&aelig;re med til at &oslash;ge vores viden om hvordan vores livsstil og omgivelser p&aring;virker vores helbred.</p>\r\n\r\n<p>Da vi ikke vil besv&aelig;re dig med sp&oslash;rgeskemaer bruger vi data der allerede er indsamlet i andre sammenh&aelig;nge som afspejler din livsstil og dit helbred, og som vi mener kan v&aelig;re mere pr&aelig;cise end sp&oslash;rgeskemaer hvor man hurtigt glemmer sm&aring; men m&aring;ske betydningsfulde sm&aring;indk&oslash;b.</p>\r\n\r\n<p><strong>Hvorfor deltage (nytten)</strong></p>\r\n\r\n<p>Du deltager ved at donere dine indk&oslash;bsdata til forskning, s&aring; de, sammen med sundhedsoplysninger fra offentlige registre, kan skabe ny viden. Fordi disse data kan indsamles over lang tid, kan vi m&aring;ske finde m&oslash;nstre i data, der kan lede os til &aring;rsagen til flere sygdomme, og dermed m&aring;ske endda forebygge sygdommene. Dette vil kunne komme dig eller dine n&aelig;rmeste til gode inden for f&aring; &aring;r, hvis unders&oslash;gelsen g&aring;r som forventet.</p>', '<p><strong>Form&aring;l og forventet tidsforbrug OBS TEST VERSION </strong></p>\r\n\r\n<p>Vi ved stadig for lidt om, hvordan vores omgivelser og alt hvad vi spiser, drikker, ind&aring;nder og sm&oslash;rer os med, p&aring;virker vores sundhed.</p>\r\n\r\n<p>Form&aring;let med dette projekt er at unders&oslash;ge hvordan det vi k&oslash;ber, herunder vores kost, p&aring;virker helbredet, ved at analysere indk&oslash;bsm&oslash;nstre og helbredsoplysninger over tid.</p>\r\n\r\n<p>Du kan deltage, hvis du er over 18 &aring;r og har Nem-ID. Oplysninger om indk&oslash;bsm&oslash;nster og helbred kan vi indsamle automatisk fra virksomheder der tilbyder elektroniske kvitteringer, hvis du giver dit samtykke til dette.</p>\r\n\r\n<p>Vi forventer, at det kun vil tage dig f&aring; minutter at l&aelig;se formularen og deltage i projektet,</p>\r\n\r\n<p>Selvom vi i starten af projektet fokuserer p&aring; visse sygdomme, kan du donere dine data uanset om du er sund og rask, eller har en eller flere sygdomme.</p>\r\n\r\n<p>Vores fokus vil i starten is&aelig;r v&aelig;re p&aring;, hvordan opblussen i kroniske sygdomme p&aring;virkes af vores livsstil og hvordan vi kan blive bedre til at opspore madvarer som giver d&aring;rlig mave.&nbsp;</p>\r\n\r\n<p>Form&aring;let med denne formular er, at hj&aelig;lpe dig til at beslutte, om du &oslash;nsker at deltage i unders&oslash;gelsen.</p>\r\n\r\n<p><strong>Om samtykket</strong></p>\r\n\r\n<p>Dit samtykke til at deltage er helt frivilligt, og du kan til enhver tid udtr&aelig;de af unders&oslash;gelsen og bede om, at f&aring; dine data slettet.</p>\r\n\r\n<p>Eventuel l&aelig;gelig behandling vil ikke blive ber&oslash;rt af, om du deltager eller ej.</p>\r\n\r\n<p>S&aring;fremt vi &oslash;nsker at videregive dine indk&oslash;bsdata til et nyt forskningsprojekt, s&aring; vil vi indhente et nyt samtykke fra dig.</p>\r\n\r\n<p>Vi stiller dig nogle sp&oslash;rgsm&aring;l til sidst for at sikre, at vi har f&aring;et forklaret projektet ordentligt til dig.</p>\r\n\r\n<p><strong>Hvorfor deltage (baggrund)</strong></p>\r\n\r\n<p>Vi ved stadig for lidt om, hvordan vores omgivelser og alt hvad vi spiser, drikker, ind&aring;nder og sm&oslash;rer os med, p&aring;virker vores sundhed.</p>\r\n\r\n<p><strong>Hvorfor deltage (metode)</strong></p>\r\n\r\n<p>Vi vil invitere dig til at v&aelig;re med til at &oslash;ge vores viden om hvordan vores livsstil og omgivelser p&aring;virker vores helbred.</p>\r\n\r\n<p>Da vi ikke vil besv&aelig;re dig med sp&oslash;rgeskemaer bruger vi data der allerede er indsamlet i andre sammenh&aelig;nge som afspejler din livsstil og dit helbred, og som vi mener kan v&aelig;re mere pr&aelig;cise end sp&oslash;rgeskemaer hvor man hurtigt glemmer sm&aring; men m&aring;ske betydningsfulde sm&aring;indk&oslash;b.</p>\r\n\r\n<p><strong>Hvorfor deltage (nytten)</strong></p>\r\n\r\n<p>Du deltager ved at donere dine indk&oslash;bsdata til forskning, s&aring; de, sammen med sundhedsoplysninger fra offentlige registre, kan skabe ny viden. Fordi disse data kan indsamles over lang tid, kan vi m&aring;ske finde m&oslash;nstre i data, der kan lede os til &aring;rsagen til flere sygdomme, og dermed m&aring;ske endda forebygge sygdommene. Dette vil kunne komme dig eller dine n&aelig;rmeste til gode inden for f&aring; &aring;r, hvis unders&oslash;gelsen g&aring;r som forventet.</p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(149, 35, 7, 'dk', '1970-01-01-how-this-study-works', 'Hvordan virker det', '', '<p>I dette forskningsprojekt beder vi dig donere dine kvitteringer s&aring; vi kan f&aring; ny viden om hvordan vi kan forebygge sygdomme.</p>\r\n\r\n<p>Projektet tager kun den tid det tager dig at tilmelde dig, da vi automatisk vil modtage dine kvitteringer s&aring; l&aelig;nge du tillader det.&nbsp;</p>\r\n\r\n<p>Vi indsamler ogs&aring; information om dit helbred som laboratoriesvar medicin, kirurgi og kontakter til sundhedssystemet.&nbsp;</p>\r\n\r\n<p>Ved at analysere dine og andres data h&aring;ber vi at finde &aring;rsager til hvorfor&nbsp;sygdomme opst&aring;r eller forv&aelig;rres som vi ikke tidligere har kunnet finde.</p>', '', NULL, NULL, '4998Billede1.jpg', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(150, 37, 8, 'dk', '2016-08-19-mads-melbye-professor', 'Mads Melbye, Professor', '<p>Projektet udg&aring;r fra&nbsp;Statens Serum Institut.&nbsp;</p>\r\n\r\n<p>Statens Serum Institut&nbsp;mission&nbsp;er at styrke&nbsp;sundheden gennem sygdomskontrol og forskning.&nbsp;<a href=\"http://www.ssi.dk/\">http://www.SSI.dk</a>&nbsp;&nbsp;</p>\r\n\r\n<p>Professor Mads Melbye har mange &aring;rs erfaring med register baseret forskning og forskningsledelse. Mads Melbyes CV og kontaktoplysninger kan findes&nbsp;<a href=\"http://www.ssi.dk/Service/Kontakt/Medarbejdere/Person.aspx?id=bf424b34-43a6-40af-979f-9d8800af6c5d\">Her</a></p>\r\n\r\n<p>&nbsp;</p>', '<p>Projektet udg&aring;r fra&nbsp;Statens Serum Institut.&nbsp;</p>\r\n\r\n<p>Statens Serum Institut&nbsp;mission&nbsp;er at styrke&nbsp;sundheden gennem sygdomskontrol og forskning.&nbsp;<a href=\"http://www.ssi.dk/\">http://www.SSI.dk</a>&nbsp;&nbsp;</p>\r\n\r\n<p>Professor Mads Melbye har mange &aring;rs erfaring med register baseret forskning og forskningsledelse. Mads Melbyes CV og kontaktoplysninger kan findes&nbsp;<a href=\"http://www.ssi.dk/Service/Kontakt/Medarbejdere/Person.aspx?id=bf424b34-43a6-40af-979f-9d8800af6c5d\">Her</a></p>\r\n\r\n<p>&nbsp;</p>', '', '2016-08-19 11:15:06', '2016-08-19 11:15:06', '44109203MadsMelbye.jpg', NULL, NULL, 'Y', 'Y', 'N', 0, '', 0, 1),
(151, 55, 20, 'dk', '1970-01-01-perform-simple-tasks', 'Perform simple tasks', '<p>Perform simple tasks ...</p>', '<p><span style=\"color:rgb(35, 31, 32); font-size:14.0625px\">We&#39;ll ask you to do a few tasks and answer some questions about your</span></p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(152, 54, 19, 'dk', '1970-01-01-give-consent-to-enroll', 'Give consent to enroll', '<p>Understand the risks and benefits of participating.</p>', '<p><span style=\"color:rgb(35, 31, 32); font-size:14.0625px\">Understand the risks and benefits of participating.</span></p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(153, 34, 6, 'dk', '1970-01-01-about-this-study', 'Om dette projekt', '<p><strong><em>Har du nogensinde overvejet hvordan det du k&oslash;ber, herunder din kost&nbsp;p&aring;virker helbredet?</em></strong></p>\r\n\r\n<p>Hvis du giver os lov til automatisk at modtage dine elektroniske&nbsp;kvitteringer, n&aring;r du k&oslash;ber ind, kan du v&aelig;re med til at finde svarene p&aring; ovenst&aring;ende sp&oslash;rgsm&aring;l. Dermed kan&nbsp;du m&aring;ske bidrage til at&nbsp;forebygge sygdomme som sklerose, kr&aelig;ft og andre alvorlige sygdomme.</p>', '<h4><span style=\"font-size:24px\"><strong><em>Har du nogensinde overvejet hvordan det du spiser, drikker, sm&oslash;rer dig med, og g&oslash;r rent med, p&aring;virker dig og dine n&aelig;rmeste?</em></strong></span></h4>\r\n\r\n<p><span style=\"font-size:22px\">Hvis du giver os lov til automatisk at modtage dine elektroniske&nbsp;kvitteringer, n&aring;r du k&oslash;ber ind,&nbsp;kan du v&aelig;re med til at finde svarene p&aring; ovenst&aring;ende sp&oslash;rgsm&aring;l. Dermed kan&nbsp;du m&aring;ske bidrage til at&nbsp;forebygge sygdomme som sklerose, kr&aelig;ft og andre alvorlige sygdomme.</span></p>\r\n\r\n<p><span style=\"font-size:22px\">Den store viden vi har om vores livsstils betydning for vores helbred,&nbsp;bygger i h&oslash;j grad p&aring; sp&oslash;rgeskemaer. Vi mener at vi kan f&aring; endnu mere at vide, og m&aring;ske undg&aring; en del forvirring omkring hvad der er sundt og usundt ved at bruge kvitteringer til at f&aring; oplysninger om livsstil i stedet for sp&oslash;rgeskemaer. Fordelen ved at bruge kvitteringer er, at de kan indsamles uden besv&aelig;r for dig, ud over den tid du bruger p&aring; at give dit samtykke. Derudover kan kvitteringer&nbsp;indsamles over tid, s&aring; det er muligt&nbsp;for forskerne, at finde sammenfald&nbsp;mellem visse indk&oslash;bsm&oslash;nstre og sygdommes forl&oslash;b. &nbsp;</span></p>\r\n\r\n<p><span style=\"font-size:22px\">Vi h&aring;ber at&nbsp;du og dine n&aelig;rmeste vil hj&aelig;lpe ved at&nbsp;give jeres samtykke til at deltage.</span></p>\r\n\r\n<h1>&nbsp;</h1>\r\n\r\n<h1><span style=\"font-size:24px\"><strong>Ofte stillede sp&oslash;rgsm&aring;l:</strong></span></h1>\r\n\r\n<p><span style=\"font-size:22px\"><strong>Hvor f&aring;r i indk&oslash;bsdata fra?</strong></span></p>\r\n\r\n<p><span style=\"font-size:22px\"><span style=\"color:rgb(35, 31, 32)\">Du skal derfor v&aelig;re&nbsp;medlem af&nbsp;<a href=\"https://medlem.coop.dk\" target=\"_blank\">COOP</a>&nbsp;og/eller f&aring;&nbsp;elektroniske kvitteringer fra&nbsp;<a href=\"https://dk.storebox.com\" target=\"_blank\">Storebox</a>&nbsp;for at deltage.</span></span></p>\r\n\r\n<p><span style=\"font-size:22px\"><span style=\"color:rgb(35, 31, 32)\">Se politik for personoplysninger fra COOP&nbsp;<a href=\"https://medlem.coop.dk/datapolitikterms\" target=\"_blank\">her</a>&nbsp;og Storebox&nbsp;<a href=\"https://dk.storebox.com/#/webview/terms\" target=\"_blank\">her</a>.</span></span></p>\r\n\r\n<h1><span style=\"font-size:22px\"><strong>Hvorfor kan i ikke bare bruge anonyme data?</strong></span></h1>\r\n\r\n<p><span style=\"font-size:22px\">Hvis data var anonyme ville vi ikke kunne finde sammenh&aelig;nge mellem det vi&nbsp;k&oslash;ber og dermed hvad vi spiser, drikker, sm&oslash;rer os&nbsp;med, og g&oslash;r rent med, og de sygdomme der rammer os, hvilket er netop hvad der g&oslash;r dette projekt s&aring; unikt.&nbsp;</span></p>\r\n\r\n<p><span style=\"font-size:22px\"><strong>Hvorfor sp&oslash;rger i mig ikke bare hvad jeg spiser?</strong></span></p>\r\n\r\n<p><span style=\"font-size:22px\">Den store viden vi har om vores livsstils betydning for vores helbred,&nbsp;bygger i h&oslash;j grad p&aring; sp&oslash;rgeskemaer. Vi mener at vi kan f&aring; endnu mere at vide, og m&aring;ske undg&aring; en del forvirring omkring hvad der er sundt og usundt ved at bruge kvitteringer til at f&aring; oplysninger om livsstil i stedet for sp&oslash;rgeskemaer. Fordelen ved at bruge kvitteringer er, at de kan indsamles uden besv&aelig;r for dig, ud over den tid du bruger p&aring; at give dit samtykke.</span></p>\r\n\r\n<p><span style=\"font-size:22px\"><strong>Giver i mine data til virksomheder?</strong></span></p>\r\n\r\n<p><span style=\"font-size:22px\">Nej- vi bruger kun dine data til forskning. Politik for h&aring;ndtering af persondata for de l&oslash;sninger&nbsp;der giver os mulighed for at indsamle indk&oslash;bsdata</span><span style=\"font-size:22px\">&nbsp;kan findes her:</span></p>\r\n\r\n<p><span style=\"font-size:22px\"><span style=\"color:rgb(35, 31, 32)\">Se politik for personoplysninger fra COOP&nbsp;<a href=\"https://medlem.coop.dk/datapolitikterms\" target=\"_blank\">her</a>&nbsp;og Storebox&nbsp;<a href=\"https://dk.storebox.com/#/webview/terms\" target=\"_blank\">her</a>.</span></span></p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(155, 59, 2, 'dk', '2017-01-05-coop-lancerer-kvitteringslosning', 'COOP lancerer kvitteringsløsning', '<p>En ny kvitteringsl&oslash;sning er nu tilg&aelig;ngleig for COOPs medlemmer se nyhed:</p>\r\n\r\n<p>https://medlem.coop.dk/medlemsfordele/digitale+boner</p>', '<p><span style=\"font-size:13px\">En ny kvitteringsl&oslash;sning er nu tilg&aelig;ngleig for COOPs medlemmer se nyhed:</span></p>\r\n\r\n<p><span style=\"font-size:13px\">https://medlem.coop.dk/medlemsfordele/digitale+boner</span></p>', '', '2017-01-05 10:53:36', '2017-01-05 10:53:36', '41811269COOPreceiptsdata.JPG', NULL, NULL, 'N', 'Y', 'N', 0, '', 0, 2),
(156, 60, 8, 'en', '2017-05-01-frederik-trier-moller', 'Frederik Trier Møller (en)', '<p>L&aelig;ge ph.d. Frederik Trier M&oslash;ller</p>\r\n\r\n<p>Projektet udg&aring;r fra&nbsp;Statens Serum Institut.&nbsp;</p>\r\n\r\n<p>Statens Serum Institut&nbsp;mission&nbsp;er at styrke&nbsp;sundheden gennem sygdomskontrol og forskning.&nbsp;<a href=\"http://www.ssi.dk/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(243, 130, 134); text-decoration-line: none; padding: 0px; margin: 0px; transition: background-color 0.2s;\">http://www.SSI.dk</a>&nbsp;&nbsp;</p>\r\n\r\n<p>Frederik Trier M&oslash;ller&nbsp;er projektleder og idemand p&aring; projektet&nbsp;og har erfaring med etablering af forskningsinfrastruktur samt registerforskning.</p>', '<p>L&aelig;ge ph.d. Frederik Trier M&oslash;ller</p>\r\n\r\n<p>Projektet udg&aring;r fra&nbsp;Statens Serum Institut.&nbsp;</p>\r\n\r\n<p>Statens Serum Institut&nbsp;mission&nbsp;er at styrke&nbsp;sundheden gennem sygdomskontrol og forskning.&nbsp;<a href=\"http://www.ssi.dk/\" style=\"color: rgb(243, 130, 134); box-sizing: border-box; background-color: transparent; text-decoration-line: none; padding: 0px; margin: 0px; transition: background-color 0.2s;\">http://www.SSI.dk</a>&nbsp;&nbsp;</p>\r\n\r\n<p>Frederik Trier M&oslash;ller&nbsp;er projektleder og idemand p&aring; projektet&nbsp;og har erfaring med etablering af forskningsinfrastruktur samt registerforskning.</p>', '', '2017-05-01 17:39:54', '2017-05-01 17:39:54', '', NULL, NULL, 'N', 'Y', 'N', 0, NULL, 0, 1),
(157, 60, 8, 'dk', '2017-05-01-frederik-trier-moller-laege', 'Frederik Trier Møller, Læge', '<p>Frederik Trier M&oslash;ller&nbsp;er projektleder og idemand,&nbsp;og har erfaring med etablering af forskningsinfrastruktur samt registerforskning.</p>\r\n\r\n<p>Projektet udg&aring;r fra&nbsp;Statens Serum Institut.&nbsp;</p>\r\n\r\n<p>Statens Serum Institut&nbsp;mission&nbsp;er at styrke&nbsp;sundheden gennem sygdomskontrol og forskning.&nbsp;<a href=\"http://www.ssi.dk/\" style=\"color: rgb(243, 130, 134); box-sizing: border-box; background-color: transparent; text-decoration-line: none; padding: 0px; margin: 0px; transition: background-color 0.2s;\">http://www.SSI.dk</a>&nbsp;&nbsp;</p>', '<p>Frederik Trier M&oslash;ller&nbsp;er projektleder og idemand. og har erfaring med etablering af forskningsinfrastruktur samt registerforskning.</p>\r\n\r\n<p>Projektet udg&aring;r fra&nbsp;Statens Serum Institut.&nbsp;</p>\r\n\r\n<p>Statens Serum Institut&nbsp;mission&nbsp;er at styrke&nbsp;sundheden gennem sygdomskontrol og forskning.&nbsp;<a href=\"http://www.ssi.dk/\" style=\"color: rgb(243, 130, 134); box-sizing: border-box; background-color: transparent; text-decoration-line: none; padding: 0px; margin: 0px; transition: background-color 0.2s;\">http://www.SSI.dk</a>&nbsp;&nbsp;</p>', '', '2017-05-01 17:39:54', '2017-05-01 17:39:54', '', NULL, NULL, 'Y', 'Y', 'N', 0, '', 0, 1),
(158, 36, 9, 'sw', '2016-08-19-who-is-eligible-to-participate', 'Who is Eligible to Participate', '', '<p>We invite you to help us increase our knowledge of how our lifestyle and surroundings affect our health, Why do people get salmonellosis and what lifestyle determinants&nbsp;affects chronic inflammatory diseases such as Inflammatory bowel disease multiple sclerosis and arthritis?&nbsp;&nbsp;</p>\r\n\r\n<p>You can help us increase our knowledge by agreeing to donate your digital consumer receipts&nbsp;and health information from public records.&nbsp;<em><strong>Together we can discover new knowledge.</strong></em></p>\r\n\r\n<p>Though we focus on specific diseases in the beginning anyone can join including family and friends, the only requiment is that you read and understand our information sign with you nem-id and donate your digital receipts.</p>\r\n\r\n<p>Don&rsquo;t have access to your digital receipts? You can&nbsp;recieve digital receipts from&nbsp;<a href=\"https://medlem.coop.dk\" target=\"_blank\">COOP</a>&nbsp;and <a href=\"https://dk.storebox.com\" target=\"_blank\">Storebox</a>&nbsp;(opens a new window, at&nbsp;a commercial site)&nbsp;.</p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"color:rgb(35, 31, 32)\">Data policy for&nbsp;<a href=\"http://medlem.coop.dk/datapolitikterms\" target=\"_blank\">COOP</a> and <a href=\"http://dk.storebox.com/#/webview/terms\">S</a><a href=\"http://dk.storebox.com/#/webview/terms\" target=\"_blank\">torebox</a>. </span>​</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1><span style=\"font-size:16px\"><strong>Frequently asked questions</strong></span></h1>\r\n\r\n<p><strong>Why cant researchers&nbsp;just use anonmyous receipts data?</strong></p>\r\n\r\n<p>The researchers hope to find out what how product you buy causes and reactives disease and how to prevent the diseases. To do so researchers have to connect information about what you buy with information about your health, after this connection is made data about who you are&nbsp;is seperated from what you buy and your informations about health and disease.</p>\r\n\r\n<p><strong>Why dont you just ask me what i eat?</strong></p>\r\n\r\n<p>Because answering questionaires take time for you and besides&nbsp;receipts can tell us the exact product you buy at an exact time, using this information we can find out if certain products&nbsp;<span style=\"font-size:13px\">auses and reactives disease and how to prevent the diseases.</span></p>\r\n\r\n<div>&nbsp;</div>', '', '2016-08-19 00:00:00', '2016-08-19 01:00:00', '', NULL, NULL, 'Y', 'Y', 'N', 0, '', 0, 0),
(159, 39, 2, 'sw', '2016-08-19-dansk-familie-donerer-deres', 'Dansk familie donerer deres kvitteringer fra de sidste 10 år', '<p>L&aelig;s nyheden fra Aalborg universitet</p>\r\n\r\n<p><a href=\"http://www.aau.dk/nyheder/uddannelse/vis/vores-digitale-aftryk-kan-forbedre-forbrugersundheden.cid294887\">http://www.aau.dk/nyheder/uddannelse/vis/vores-digitale-aftryk-kan-forbedre-forbrugersundheden.cid294887</a></p>', '<p><span style=\"font-size:10pt\">L&aelig;s nyheden fra Aalborg universitet</span></p>\r\n\r\n<p><span style=\"font-size:10pt\"><a href=\"http://www.aau.dk/nyheder/uddannelse/vis/vores-digitale-aftryk-kan-forbedre-forbrugersundheden.cid294887\">http://www.aau.dk/nyheder/uddannelse/vis/vores-digitale-aftryk-kan-forbedre-forbrugersundheden.cid294887</a></span></p>', '', '2016-08-19 15:50:10', '2016-08-19 15:50:10', '82516618AAUnewsreceiptsdata.JPG', NULL, NULL, 'Y', 'Y', 'N', 0, '', 0, 2);
INSERT INTO `bc_info` (`pk`, `id`, `section_id`, `language`, `slug`, `title`, `description`, `content`, `url`, `start_date`, `end_date`, `thumbnail`, `lng`, `lat`, `published`, `important`, `slider`, `connected_gall`, `connected_info`, `sort`, `important_type`) VALUES
(160, 47, 14, 'sw', '1970-01-01-aim-and-time-commited', 'Aim and time commited. This is TEST version do not try to participate', '<p>This study aims to find new correlations between what you buy and your health, using receipt data donated by you.<br />\r\n<a href=\"http://www.nordicehealth.se/InformedConsent-app/html/#\" style=\"margin: 0px; padding: 0px; transition:background-color 0.2s; color: rgb(243, 130, 134); text-decoration: none; box-sizing: border-box; background-color: transparent;\">Our initial focus will be on the determinants of flares in chronic diseases.</a><br />\r\nThe purpose of this form is to help you to decide whether you want to participate in the study.<br />\r\nWe expect participating in the study, reading, and filling out this form will take 10 to 15 minutes.</p>\r\n\r\n<p>You must be at least 18 years old to participate.</p>', '<p>This study aims to find new correlations between what you buy and your health, using receipt data donated by you.<br />\r\n<a href=\"http://www.nordicehealth.se/InformedConsent-app/html/#\" style=\"margin: 0px; padding: 0px; transition:background-color 0.2s; color: rgb(243, 130, 134); text-decoration: none; box-sizing: border-box; background-color: transparent;\">Our initial focus will be on the determinants of flares in chronic diseases.</a><br />\r\nThe purpose of this form is to help you to decide whether you want to participate in the study.<br />\r\nWe expect participating in the study, reading, and filling out this form will take 10 to 15 minutes.</p>\r\n\r\n<p>You must be at least 18 years old to participate.</p>\r\n\r\n<h1>The consent</h1>\r\n\r\n<p>Your consent to participate is entirely voluntary and you can, at any time, withdraw from the study and have your data deleted. Data identifying you is securely stored and will not be disclosed to any third party without your consent. Any medical treatment you receive is not affected by your participation, but your participation may improve treatment and prevention in the future.</p>\r\n\r\n<p>It is important that we explain the study properly to you, and we will therefore ask some questions at the end of this form, to ensure that we have infromed you adequatly.</p>\r\n\r\n<h2>Why participate (background)</h2>\r\n\r\n<p>There is a lack of knowlegde regarding how our lifestyle, i.e. everything we eat, drink, breathe, and apply to our skin. affects our health.</p>\r\n\r\n<h2>Why participate (method)</h2>\r\n\r\n<p>We invite you to help us increase our knowledge of how our lifestyle and surroundings affect our health. You can help us by agreeing to donate your receipts data for research. Along with health information from public records we can discover new knowledge.</p>\r\n\r\n<h2>Why participate (usefulness)</h2>\r\n\r\n<p>Because this data can be collected over a long time, we can find patterns in data that can potetially lead us to determinants of several diseases and thus perhaps even prevent some diseases in the future, that might affect you or your loved ones.</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0);
INSERT INTO `bc_info` (`pk`, `id`, `section_id`, `language`, `slug`, `title`, `description`, `content`, `url`, `start_date`, `end_date`, `thumbnail`, `lng`, `lat`, `published`, `important`, `slider`, `connected_gall`, `connected_info`, `sort`, `important_type`) VALUES
(161, 35, 7, 'sw', '1970-01-01-how-this-study-works', 'How this Study Works', '', '<p>Have you ever wondered if any of the addititves, chemicals or food you eat might prevent or promote disease onset?</p>\r\n\r\n<p>We invite you to help us increase our knowledge of how our lifestyle and surroundings affect our health. You can help us by agreeing to donate your receipts data&nbsp;long with health information from public records. We can use the data donated by you and others to&nbsp;discover new knowledge.</p>\r\n\r\n<p>Because this data can be collected over a long time and with great detail, we can find patterns in data that can potentially lead us to determinants of several diseases and thus perhaps even prevent some diseases in the future, that might affect you or your loved ones.</p>', '', NULL, NULL, '4998Billede1.jpg', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(162, 55, 20, 'sw', '1970-01-01-perform-simple-tasks', 'Perform simple tasks', '<p>Perform simple tasks ...</p>', '<p><span style=\"color:rgb(35, 31, 32); font-size:14.0625px\">We&#39;ll ask you to do a few tasks and answer some questions about your</span></p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(163, 54, 19, 'sw', '1970-01-01-give-consent-to-enroll', 'Give consent to enroll', '<p>Understand the risks and benefits of participating.</p>', '<p><span style=\"color:rgb(35, 31, 32); font-size:14.0625px\">Understand the risks and benefits of participating.</span></p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(164, 59, 2, 'sw', '2017-01-05-coop-lancerer-kvitteringslosning', 'COOP lancerer kvitteringsløsning', '<p>COOP lancerer digital kvitteringsl&oslash;sning</p>\r\n\r\n<p><a href=\"https://medlem.coop.dk/medlemsfordele/digitale+boner\" style=\"font-size: 13px;\">https://medlem.coop.dk/medlemsfordele/digitale+boner</a></p>\r\n\r\n<p>&nbsp;</p>', '<p>COOP lancerer digital kvitteringsl&oslash;sning</p>\r\n\r\n<p><a href=\"https://medlem.coop.dk/medlemsfordele/digitale+boner\" style=\"font-size: 13px;\">https://medlem.coop.dk/medlemsfordele/digitale+boner</a></p>', '', '2017-01-05 10:53:36', '2017-01-05 10:53:36', '41811269COOPreceiptsdata.JPG', NULL, NULL, 'Y', 'Y', 'N', 0, '', 0, 2);
INSERT INTO `bc_info` (`pk`, `id`, `section_id`, `language`, `slug`, `title`, `description`, `content`, `url`, `start_date`, `end_date`, `thumbnail`, `lng`, `lat`, `published`, `important`, `slider`, `connected_gall`, `connected_info`, `sort`, `important_type`) VALUES
(165, 49, 16, 'sw', '1970-01-01-is-there-any-risk-to-me', 'Is there any risk to me?', '<p>There is no health risk associated with the project, and we expect that the project will benefit you within a few years through better understanding disease determinats and improved lifestyle advice. Despite our comprehensive security efforts to protect data from theft and destruction, we cannot completely rule out unauthorized access to data. We do however consider this risk to be minimal.</p>\r\n\r\n<p>What happens to my data?</p>\r\n\r\n<p>Your data will be collected on a secure server in de-identified form. Your contact information is stored on a separate server. To ensure confidentiality, the same person will not have access to both identification and research data.</p>\r\n\r\n<p>Of note, the project also retrieves data from a private data source. See privacy policy <a href=\"https://dk.storebox.com/beta/#/webview/terms\" target=\"_blank\">here</a>.</p>\r\n\r\n<p><a class=\"de-identification\" href=\"http://www.nordicehealth.se/InformedConsent-app/html/#\" style=\"margin: 0px; padding: 0px; transition:background-color 0.2s; color: rgb(114, 191, 68); text-decoration: none; box-sizing: border-box; background-color: transparent;\">Learn more about de-identification</a></p>', '<p>There is no health risk associated with the project , and we expect that the project will benefit you within a few years through better understanding disease determinats and improved lifestyle advice. Despite our comprehensive security efforts to protect data from theft and destruction, we cannot completely rule out unauthorized access to data. We do however consider this risk to be minimal.</p>\r\n\r\n<h1>What happens to my data?</h1>\r\n\r\n<p>Your data will be collected on a secure server in de-identified form. Your contact information is stored on a separate server.</p>\r\n\r\n<p>To ensure confidentiality, the same person will not have access to both identification and reasearch data.</p>\r\n\r\n<p>Of note, the project also retrieves data from a private data source. See privacy policy <a href=\"https://dk.storebox.com/beta/#/webview/terms\" target=\"_blank\">here</a>.</p>\r\n\r\n<p><img src=\"data:image/png;base64,\" /></p>\r\n\r\n<p>&nbsp;</p>', '', NULL, NULL, '7281Slide4.JPG', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0);
INSERT INTO `bc_info` (`pk`, `id`, `section_id`, `language`, `slug`, `title`, `description`, `content`, `url`, `start_date`, `end_date`, `thumbnail`, `lng`, `lat`, `published`, `important`, `slider`, `connected_gall`, `connected_info`, `sort`, `important_type`) VALUES
(166, 57, 22, 'sw', '1970-01-01-scientists-make-discoveries', 'Scientists make discoveries', '', '<p><span style=\"color:rgb(35, 31, 32); font-size:14.0625px\">Scientists will use your data to make breakthroughs in medical research and treatments.</span></p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(167, 56, 21, 'sw', '1970-01-01-track-your-health', 'Track your health', '', '<p><span style=\"color:rgb(35, 31, 32); font-size:14.0625px\">You can use the health dashboard to track your health data.</span></p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(168, 50, 17, 'sw', '1970-01-01-consent-aproach', 'Consent aproach', '', '<p><strong>You sign up by</strong></p>\r\n\r\n<ol>\r\n	<li>Checking the boxes below,</li>\r\n	<li>Enter your contact information, free storebox account email, if different from the above.</li>\r\n	<li>Giving consent with the NEM-ID signature.</li>\r\n	<li>Validating your email by clicking the link provided by storebox</li>\r\n</ol>\r\n\r\n<h1>Focusing research:</h1>\r\n\r\n<p>Chronic diseases are important to us. We therefore ask you fill out the items below:<br />\r\nDo you suffer from one or more chronic diseseas that you would like us to prioritze?</p>\r\n\r\n<div class=\"form-inline row\" style=\"margin: 0px; padding: 0px; color: rgb(35, 31, 32); line-height: 12.85px; font-family: mariad_pro; font-size: 9px; box-sizing: border-box;\">\r\n<p>&nbsp;</p>\r\n</div>', '', NULL, NULL, '', NULL, NULL, 'N', 'N', 'N', 0, NULL, 0, 0),
(169, 51, 18, 'sw', '1970-01-01-receipt-page', 'Receipt Page', '', '<p>Thank you for participating in the project.</p>\r\n\r\n<p>If you do not have a storebox account:<br />\r\nUse the contact email and phone number you entered above and register here:<br />\r\n<a href=\"https://dk.storebox.com/beta/#/signup/info\" target=\"_blank\">https://dk.storebox.com/beta/#/signup/info</a><br />\r\nYou can read more about storebox here:<br />\r\n<a href=\"https://dk.storebox.com/beta/#/web\" target=\"_blank\">https://dk.storebox.com/beta/#/signup/info</a><br />\r\nMore about the project: <a href=\"?\">Back to landing page</a><br />\r\nYou may at any time withdraw from the study: <a href=\"http://www.nordicehealth.se/InformedConsent-app/html/en/windraw-consent/\">Withdraw consent</a></p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(170, 48, 15, 'sw', '1970-01-01-the-consent', 'The consent', '<p>Your consent to participate is entirely voluntary and you can, at any time, withdraw from the study and have your data deleted. Data identifying you is securely stored and will not be disclosed to any third party without your consent. Any medical treatment you receive is not affected by your participation, but your participation may improve treatment and prevention in the future.</p>\r\n\r\n<p>It is important that we explain the study properly to you, and we will therefore ask some questions at the end of this form, to ensure that we have infromed you adequatly.</p>\r\n\r\n<p>Why participate (background)</p>\r\n\r\n<p>There is a lack of knowlegde regarding how our lifestyle, i.e. everything we eat, drink, breathe, and apply to our skin. affects our health.</p>\r\n\r\n<p>Why participate (method)</p>\r\n\r\n<p>We invite you to help us increase our knowledge of how our lifestyle and surroundings affect our health. You can help us by agreeing to donate your receipts data for  research. Along with health information from public records we can discover new knowledge.</p>\r\n\r\n<p>Why participate (usefulness)</p>\r\n\r\n<p>Because this data can be collected over a long time, we can find patterns in data that can potetially lead us to determinants of several diseases and thus perhaps even prevent some diseases in the future, that might affect you or your loved ones.</p>', '<p>Your consent to participate is entirely voluntary and you can, at any time, withdraw from the study and have your data deleted. Data identifying you is securely stored and will not be disclosed to any third party without your consent. Any medical treatment you receive is not affected by your participation, but your participation may improve treatment and prevention in the future.</p>\r\n\r\n<p>It is important that we explain the study properly to you, and we will therefore ask some questions at the end of this form, to ensure that we have infromed you adequatly.</p>\r\n\r\n<h2>Why participate (background)</h2>\r\n\r\n<p>There is a lack of knowlegde regarding how our lifestyle, i.e. everything we eat, drink, breathe, and apply to our skin. affects our health.</p>\r\n\r\n<h2>Why participate (method)</h2>\r\n\r\n<p>We invite you to help us increase our knowledge of how our lifestyle and surroundings affect our health. You can help us by agreeing to donate your receipts data for research. Along with health information from public records we can discover new knowledge.</p>\r\n\r\n<h2>Why participate (usefulness)</h2>\r\n\r\n<p>Because this data can be collected over a long time, we can find patterns in data that can potetially lead us to determinants of several diseases and thus perhaps even prevent some diseases in the future, that might affect you or your loved ones.</p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(171, 40, 5, 'sw', '', 'Contact information', 'Stockholms Centralstation, Centralplan, Stockholm, Sweden', '', '658123654789', NULL, NULL, 'test@email.com', '18.043277343749992', '59.349770365472885', 'Y', 'Y', 'N', 0, NULL, 0, 0),
(172, 58, 3, 'sw', '2016-10-26-test-publication', 'test publication', '1751danskeslidesoct2016.pdf', '', '', '2016-10-26 13:35:27', '2016-10-26 13:35:27', '1212Aimandtimecommited.JPG', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(173, 42, 3, 'sw', '2016-08-20-journal-of-orthopaedic-surgery', 'Journal of Orthopaedic Surgery', '1558homepageImage.jpg', '', '', '2016-08-20 16:02:46', '2016-08-20 16:02:46', '6502homepageImage.jpg', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(174, 43, 3, 'sw', '2016-08-20-hong-kong-journal-of-gynaecology', 'Hong Kong Journal of Gynaecology, Obstetrics and Midwifery', '2317homepageImage_en_US.jpg', '', '', '2016-08-20 16:04:04', '2016-08-20 16:04:04', '9034homepageImage_en_US.jpg', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(175, 44, 3, 'sw', '2016-08-20-asian-journal-of-gerontology-', 'Asian Journal of Gerontology & Geriatrics', '8646images.jpg', '', '', '2016-08-20 16:04:27', '2016-08-20 16:04:27', '9857images.jpg', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(176, 45, 3, 'sw', '2016-08-20-east-asian-archives-of-psychiatry', 'East Asian Archives of Psychiatry', '7581HKJPCap.jpg', '', 'http://mydocuments.ge/phpmyadmin/index.php?db=mydocume_res&token=9d3123d987e4083e2d486ac9db9b181a', '2016-08-20 16:04:46', '2016-08-20 16:04:46', '9352HKJPCap.jpg', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(177, 46, 13, 'sw', '46-please-answer-this-short-multiple-choice', 'Please answer this short multiple-choice questionnaire to make sure we have conveyed our information correctly', '', '', '', '2016-08-25 18:40:09', '0000-00-00 00:00:00', '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(178, 37, 8, 'sw', '2016-08-19-mads-melbye-professor', 'Mads Melbye, Professor', '<p>Mads Melbye is the President (CEO) of Statens Serum Institut. His main focus has been in population health science research taking advantage of the unique Nordic population based registers and biobanks. He has gained experience in performing large scale epidemiologic studies based on e.g. the Nordic national registries, and the Danish National Birth Cohort. In the last decade, the research has been described three times in more general articles in Science, with titles as &ldquo;When an entire country is a cohort,&rdquo; &ldquo;The epidemiologist&rsquo;s dream: Denmark&rdquo; and &ldquo;Science gold mine&rdquo;. Professor Melbye regards the present study as a unique opportunity to investigate the impact of&nbsp;everyday purchases on our health.</p>', '<p>Mads Melbye is the President (CEO) of Statens Serum Institut. His main focus has been in population health science research taking advantage of the unique Nordic population based registers and biobanks. He has gained experience in performing large scale epidemiologic studies based on e.g. the Nordic national registries, and the Danish National Birth Cohort. In the last decade, the research has been described three times in more general articles in Science, with titles as &ldquo;When an entire country is a cohort,&rdquo; &ldquo;The epidemiologist&rsquo;s dream: Denmark&rdquo; and &ldquo;Science gold mine&rdquo;. Professor Melbye regards the present study as a unique opportunity to investigate the impact of&nbsp;everyday purchases on our health.</p>', '', '2016-08-19 11:15:06', '2016-08-19 11:15:06', '44109203MadsMelbye.jpg', NULL, NULL, 'Y', 'Y', 'N', 0, '', 0, 1),
(179, 34, 6, 'sw', '1970-01-01-about-this-study', 'About this study', '<p><em><strong>Have you ever wondered if any of the additives, chemicals or food you eat might prevent or promote disease onset?</strong></em></p>\r\n\r\n<p>You can become a research partner by simply agreeing to donate your digital receipts to us, and allow us to collect information about your health. In turn we will do our utmost to protect your data, and use your data improve health.</p>', '<p><em><strong><span style=\"font-size:10pt\">Have you ever wondered if any of the additives, chemicals or food you eat might prevent or promote disease onset?</span></strong></em></p>\r\n\r\n<p><span style=\"font-size:10pt\">For years questionnaires has been used to study how our lifestyle affects our health, but for many diseases this research has been in vain. I this study, we will use a novel method;&nbsp;information about purchasing pattern. This allows&nbsp;us to analyze how lifestyle affects a number of diseases in much greater detail and over a longer timespan than ever&nbsp;tried before.&nbsp;It is our hypothesis that this will enable us to&nbsp;provide lifestyle advice that may prevent disease onset and reactivation in a number of diseases where such advice is not available today. </span></p>\r\n\r\n<p><span style=\"font-size:10pt\">You can become a research partner by simply agreeing to donate your digital receipts to us, and allow us to collect information about your health. In turn we will do our utmost to protect your data, and use your data improve health.</span></p>\r\n\r\n<p>&nbsp;</p>', '', NULL, NULL, '', NULL, NULL, 'Y', 'N', 'N', 0, NULL, 0, 0),
(180, 60, 8, 'sw', '2017-05-01-frederik-trier-moller', 'Frederik Trier Møller (en)', '<p>L&aelig;ge ph.d. Frederik Trier M&oslash;ller</p>\r\n\r\n<p>Projektet udg&aring;r fra&nbsp;Statens Serum Institut.&nbsp;</p>\r\n\r\n<p>Statens Serum Institut&nbsp;mission&nbsp;er at styrke&nbsp;sundheden gennem sygdomskontrol og forskning.&nbsp;<a href=\"http://www.ssi.dk/\" style=\"box-sizing: border-box; background-color: transparent; color: rgb(243, 130, 134); text-decoration-line: none; padding: 0px; margin: 0px; transition: background-color 0.2s;\">http://www.SSI.dk</a>&nbsp;&nbsp;</p>\r\n\r\n<p>Frederik Trier M&oslash;ller&nbsp;er projektleder og idemand p&aring; projektet&nbsp;og har erfaring med etablering af forskningsinfrastruktur samt registerforskning.</p>', '<p>L&aelig;ge ph.d. Frederik Trier M&oslash;ller</p>\r\n\r\n<p>Projektet udg&aring;r fra&nbsp;Statens Serum Institut.&nbsp;</p>\r\n\r\n<p>Statens Serum Institut&nbsp;mission&nbsp;er at styrke&nbsp;sundheden gennem sygdomskontrol og forskning.&nbsp;<a href=\"http://www.ssi.dk/\" style=\"color: rgb(243, 130, 134); box-sizing: border-box; background-color: transparent; text-decoration-line: none; padding: 0px; margin: 0px; transition: background-color 0.2s;\">http://www.SSI.dk</a>&nbsp;&nbsp;</p>\r\n\r\n<p>Frederik Trier M&oslash;ller&nbsp;er projektleder og idemand p&aring; projektet&nbsp;og har erfaring med etablering af forskningsinfrastruktur samt registerforskning.</p>', '', '2017-05-01 17:39:54', '2017-05-01 17:39:54', '', NULL, NULL, 'N', 'Y', 'N', 0, NULL, 0, 1);

